import React from 'react'
import styled from 'styled-components';

const Style = styled.div`
	display: flex;
	flex-direction: column;
	position: relative;
	height: 100%;

	&::after {
		background-color: black;
		content: '';
		position: absolute;
		top: 50%;		
		height: 4px;
		width: 70%;
		left: 10%;
	}
`;

function TimelineContainer(props) {
	return (
		<Style>

			{props.children}


		</Style>
	)
}

export default TimelineContainer;
